void GetStringById(int id, char *out) {
	void *ptr = *(void **)sublevel_string_list;

	ptr = *(void **)((int)ptr + (id * 4));
	ptr = (void *)((int)ptr + 0x10);

	sprintf(out, "%ws", (wchar_t *)ptr);
}

int GetIdByString(char *str) {
	void *ptr = (void *)sublevel_id_list;
	ptr = *(void **)ptr;
	ptr = *(void **)((int)ptr + 0x50);
	ptr = **(void ***)((int)ptr + 0x3C);

	int sublevel_count = *(int *)((int)ptr + 0xBF0);
	void *sublevels_base = *(void **)((int)ptr + 0xBEC);

	static char sublevel_name[0xFFF];
	for (int i = 0; i < sublevel_count; i++) {
		void *sublevel = *(void **)((int)sublevels_base + (i * 4));
		if (!sublevel) {
			continue;
		}

		int sublevel_id = *(int *)((int)sublevel + 0x3C);
		GetStringById(sublevel_id, sublevel_name);

		if (strcmp(str, sublevel_name) == 0) {
			return sublevel_id;
		}
	}

	return 0;
}

char GetSublevelStatus(char *name) {
	if (!name) {
		return 0;
	}

	void *ptr = (void *)0x1FFBCA4;
	ptr = *(void **)ptr;
	ptr = *(void **)((int)ptr + 0x50);
	ptr = **(void ***)((int)ptr + 0x3C);

	int max_sublevels = *(int *)((int)ptr + 0xBF0);
	void *sublevels_base = *(void **)((int)ptr + 0xBEC);

	for (int i = 0; i < max_sublevels; i++) {
		static char sublevel_name[0xFF];

		void *sublevel = *(void **)((int)sublevels_base + (i * 4));
		if (!sublevel) {
			continue;
		}

		int sublevel_id = *(int *)((int)sublevel + 0x3C);
		GetStringById(sublevel_id, sublevel_name);
		if (!sublevel_name) {
			continue;
		}

		if (strcmp(name, sublevel_name) == 0) {
			return *(char *)((int)sublevel + 0x60);
		}
	}

	return 0;
}

void GetSublevels() {
	if (GetData()->sublevels) {
		free(GetData()->sublevels);
	}

	void *ptr = (void *)sublevel_id_list;
	ptr = *(void **)ptr;
	ptr = *(void **)((int)ptr + 0x50);
	ptr = **(void ***)((int)ptr + 0x3C);

	int sublevel_count = *(int *)((int)ptr + 0xBF0);
	void *sublevels_base = *(void **)((int)ptr + 0xBEC);

	GetData()->sublevel_count = sublevel_count;
	GetData()->sublevels = (char *)malloc(sublevel_count * 0xFFF);
	memset(GetData()->sublevels, 0, sublevel_count * 0xFFF);

	char sublevel_name[0xFFF];
	for (int i = 0; i < sublevel_count; i++) {
		void *sublevel = *(void **)((int)sublevels_base + (i * 4));
		if (!sublevel) {
			continue;
		}

		int sublevel_id = *(int *)((int)sublevel + 0x3C);
		GetStringById(sublevel_id, sublevel_name);

		strncpy((GetData()->sublevels + (i * 0xFFF)), sublevel_name, 0xFFF);
	}
}

